import React from 'react';
// Search bar for homepage

 function loginButton(){
    return (
        <React.Fragment>
            
            <div >
            <button className="login"> Login </button>

            <button className="register"> Register </button>

            </div>
           
         </React.Fragment>
    )
}

export default loginButton;
